	 (2,'Djakarta Warehouse Project','Djakarta Warehouse Project began its journey in 2008 as merely a club event that took place in Jakarta’s renowned Blowfish club called Blowfish Warehouse Project. The festival upholds one of the most consequential values that Indonesia possesses; diversity. A wide spectrum of sub-genres under the dance music category are given a platform through the multiple stages in the festival, one of them being the bird-shaped main stage called ‘Garuda Land’ inspired by the country’s coat of arms, Garuda Pancasila.\n\nThroughout its ten editions, some of the world’s biggest acts have graced the stages of Djakarta Warehouse Project including Calvin Harris, Steve Aoki, Carl Cox, Skrillex, Tiesto, Diplo, Major Lazer, Martin Garrix, David Guetta, Armin van Buuren, Axwell x Ingrosso, and DJ Snake, amongst many. Starting from 2010, the festival has been held annually in the month of December as a one-day festival until it expanded into a two-day festival in 2014 and welcomed the world’s biggest paint party, Life in Color.','https://assets.loket.com\neo/production/images/banner/K7TEz_1724747212487826.png',1,4,'JIEXPO Kemayoran, DKI Jakarta','2024-12-15 02:00:00','2024-12-15 02:00:00',1500,1500,'2024-12-15 21:04:18.347382','2024-12-16 00:58:34.387983',NULL,NULL),
	 (2,'Creative Fest 2024','Nikmati malam penuh energi di CREATIVE FEST 24, persembahan spesial dari Kabinet Inklusif BEM UNG! Tahun ini, festival kami semakin meriah dengan kehadiran HIVI! sebagai bintang tamu utama yang siap menghibur dan mengajakmu bernyanyi bersama.\n\nTiket sudah tersedia – jangan lewatkan kesempatan menikmati konser ini di bawah langit terbuka, ditemani oleh atmosfer kreatif dan semangat kolaboratif khas CREATIVE FEST! Beli tiketmu sekarang dan jadilah bagian dari pengalaman musik tak terlupakan yang akan membuat Desembermu semakin spesial!','https://assets.loket.com\neo/production/images/banner/20241023011431_6717eb87c5104.jpg',1,2,'Lapangan Rektorat UNG, Gorontalo','2024-12-18 09:00:00','2024-12-18 17:00:00',1500,1500,'2024-12-16 02:09:01.042158','2024-12-16 02:09:01.042158',NULL,NULL),
	 (2,'Sesi Ruang Tengah','Selamat datang di SESI RUANG TENGAH. Disini bukan tempat pesta melainkan tempatku bercerita. Aku bukakan pintu ruangan ini untuk kita semua dan kuhadirkan tamu spesial.\n\nBuat nyaman karena ini rumahmu dan rumahku. Tak ada kata bertamu, SESI RUANG TENGAH kini untukmu.\n\n-Rafi Sudirman\n\nSyarat & Ketentuan\n\nTiket bersifat non-refundable (tidak dapat dikembalikan) kecuali acara dibatalkan oleh penyelenggara','https://assets.loket.com\neo/production/images/banner/20241124155342_6742e9960718a.jpg',2,4,'Purwakarta','2024-12-18 09:00:00','2024-12-18 17:00:00',50,50,'2024-12-16 09:30:00.292678',NULL,NULL,NULL),
	 (2,'20Km Virtual Walk','2025\nVIRTUAL WALKING CHALLENGE\nBerjalan Dimana Saja, Kapan Saja, dan Dengan Siapa Saja, Sejauh 20,25KM.\n\nDiselesaikan secara multiple submit / boleh dicicil.\n\n27 Desember 2024 - 7 Januari 2025\n\nKontribusi : Rp 250.000\n\n(Termasuk Exclusive Jersey Indowalkers, Medali, Produk Sponsor, dan GRATIS ONGKIR)\n\nTimeline Challenge\nRegistrasi Peserta : 25 November 2024 - 20 Desember 2024\n\nMulai Tantangan : 27 November 2024 - 7 Januari 2025\n\nGARAP OFFLINE : 1 Januari 2025 di DAGADU LOKIO, YOGYAKARTA\n\nPengumuman Doorprize & Awarding : 8 Januari 2025\n\nPengiriman Jersey & Medali Finisher : per 9 Januari 2025 dari Kota Yogyakarta\n\nPREVIEW JERSEY:\n\nSyarat & Ketentuan\n\nPeraturan Tantangan, Syarat dan Ketentuan\nPeraturan Pertandingan\n\nSatu peserta wajib mendaftarkan satu akun untuk mengikuti tantangan ini.\nAGENDA INI ADALAH AGENDA TANTANGAN OLAHRAGA JALAN KAKI SEJAUH 20,25KM.\nPengerjaan tantangan dapat dilakukan secara dicicil (multiple walk) dengan minimum KM jalan adalah 2KM\nHanya peserta yang menyelesaikan 20,25KM yang akan mendapatkan FINISHER PACK\nLink submit bukti berjalan, akan dikirimkan melalui email terdaftar\nSemua submission bukti tantangan akan diverifikasi terlebih dahulu oleh panitia.\n\nSyarat & Ketentuan\n\nNon-refundable\nHarap menuliskan informasi (No HP, Alamat Email dan Alamat Pengiriman) dengan lengkap dan benar\nDengan menyelesaikan registrasi, berarti Anda patuh terhadap ketentuan yang berlaku.\nPanitia Berhak Mengeluarkan Peserta dari Tantangan Apabila Melakukan tindakan yang Mengganggu Jalannya Tantangan Virtual ini, seperti Curang dalam Melakukan Tantangan, Hate Speech & Comment di Social Media, Maupun melakukan tindakan yang kurang menyenangkan kepada panitia maupun peserta lainnya.\n\nPelepasan Tanggung Jawab\n\nEKSPERIA tidak bertanggung jawab atas kerugian yang disebabkan oleh hal-hal berikut: kecelakaan,cidera saat berjalan, atau gangguan kesehatan setelah mengikuti tantangan. Para pelari wajib memahami kesehatan masing-masing saat mengikuti tantangan\nSetelah Pengiriman dilakukan, Penyelenggara tidak bertanggungjawab atas kehilangan yang disebabkan oleh Kurir yang ditunjuk, atau Kehilangan akibat barang yang diterima oleh pihak lain kepada penerima (misal : Satpam Apartemen, Satpam Kantor, Satpam Komplek, Tetangga yang menerima, Keluaraga penerima, atau sebagainya). Sejak barang diserahkan kepada kurir, maka sepenuhnya adalah wewenang pihak Kurir dan Peserta\nApabila terjadi peristiwa-peristiwa di luar kekuasaan manusia (force majeure) termasuk namun tidak terbatas pada pemogokan kerja, kebakaran, kerusuhan massa, sabotase, pandemi, pembatasan aktivitas masyarakat, bencana alam seperti gempa bumi dan banjir atau hal-hal lain di luar kekuasaan para pihak dan tidak dapat dilaksanakan maka tidak ada pihak manapun yang dapat dituntut untuk memberikan ganti rugi atas segala kerugian yang timbul sebagai akibat terjadinya peristiwa force majeure tersebut.\nPenyelenggara berhak untuk mengubah Syarat dan Ketentuan ini yang akan diberitahukan oleh Penyelenggara kepada Peserta dalam bentuk dan melalui sarana apapun.','https://assets.loket.com\neo/production/images/banner/20241202122542_674d44d6c329c.jpg',3,2,'Online Event','2024-12-15 02:00:00','2024-12-15 02:00:00',9090,9090,'2024-12-15 18:48:46.124399','2024-12-15 18:48:46.124399',NULL,NULL),
	 (2,'BMW Golf Challenge','To create the first ever public event in Singapore for a public member to walk away with a brand-new BMW in the mission of raising fund for a charity organization.\n\nSyarat & Ketentuan\n\nProfessional golfers are prohibited from participating in this event','https://assets.loket.com\neo/production/images/banner/20241213154847_675bf4ef749fe.jpg',3,5,'Senayan','2024-12-15 02:00:00','2024-12-15 02:00:00',100,100,'2024-12-15 19:47:58.200817','2024-12-15 19:47:58.200817',NULL,NULL),
	 (2,'Cinta Kala Senja Bernadya','BENGKELIVE PRESENTS CINTA KALA SENJA LIVE IN CONCERT - BERNADYA • ADRIAN KHALIF\n\nSyarat & Ketentuan\n\nNo outside food or drink allowed\nDilarang membawa makanan atau minuman dari luar Bengkel Space\nOpen gate started at 6.30 PM\nPintu masuk di buka pada pukul 18.30 WIB\nScan your ticket barcode at the location to enter the Bengkel Space Hall\nScan barcode tiket anda di lokasi untuk memasuki aula Bengkel Space\nTickets are non-refundable\nTiket yang sudah dibeli tidak dapat dikembalikan\nWe are NOT responsible for the lost of this e-voucher\nKami tidak bertanggung jawab atas kehilangan e-voucher ini\nNO WEAPON & NO DRUGS\nDILARANG MEMBAWA SENJATA ATAU OBAT-OBATAN\nNo slippers\nDilarang menggunakan sandal jepit\nGuest are required to undergo a security check at the entrance\nPengunjung wajib melalui pemeriksaan oleh petugas keamanan di pintu masuk\nNo professional photography / videography will be allowed unless prior permission is given\nFotografer/ videografer profesional tidak diperkenankan kecuali atas izin yang diberikan sebelumnya\nTake care of your personal belongings\nJagalah bawaan pribadi anda\nWe will have every right to refuse and/or discharge entry for ticket holders that does not meet the Term & Condition\nPenyelenggara berhak untuk tidak memberikan izin untuk masuk ke dalam tempat acara apabila syarat-syarat & ketentuan tidak dipenuhi','https://assets.loket.com\neo/production/images/banner/20241029131528_67207d8061df8.jpg',1,1,'Bandung','2024-12-17 09:00:00','2024-12-17 17:00:00',500,500,'2024-12-16 09:18:55.332241',NULL,NULL,NULL),
	 (2,'LNF Music Fest by OMG Verse','Tanggal 20 Desember 2024, Sekelik Fest bekerja sama dengan OMG Verse mengundang HIVI!, J-Rocks, Rocket Rockers dan beberapa artis lainnya untuk memeriahkan acara Lampung Night Fair 2024.\n\nSyarat & Ketentuan\n\n1 (satu) e-tiket (QR Code) HANYA BERLAKU untuk 1 (satu) orang. E-ticket bersifat rahasia, jangan pernah membagikan QR code/e-ticket kalian kepada orang lain.\n1 (satu) transaksi maksimal dapat melakukan pembelian 5 (lima) e-tiket dan akun yang sama dan dapat melakukan repeat order. Khusus EARLY BIRD 1 (satu) transaksi hanya bisa membeli 1 (satu) e-tiket.\nSetiap penonton konser wajib menujukan e-ticket (QR Code) di tempat dan lokasi yang telah ditentukan oleh penyelenggara.\nTiket hanya dapat dibeli melalui website resmi https://loket.com/. Tiket yang diperoleh dari sumber yang tidak resmi, mungkin palsu, dan tidak berlaku. Pihak penyelenggara tidak bertanggung jawab atas segala bentuk penipuan tiket yang dibeli melalui pihak lain.\nPanitia memiliki hak untuk mengeluarkan penonton yang melanggar peraturan dan membuat kegaduhan. Tidak ada pengembalian uang yang dilakukan atas pelanggaran yang dilakukan oleh penonton.\nTiket yang telah dibeli TIDAK dapat dikembalikan/refund, kecuali atas penundaan/pembatalan acara dari panitia','https://assets.loket.com\neo/production/images/banner/20241117221026_673a076276d78.jpg',1,2,'Lapangan Saburai, Lampung, Lampung','2024-12-18 09:00:00','2024-12-18 17:00:00',1500,1500,'2024-12-16 02:24:36.862101','2024-12-16 02:24:36.862101',NULL,NULL),
	 (2,'Membiru di Bintaro: Kembali ke Awal','Kita semua pernah bahagia. Kalau hidup di hari ini terasa rumit, mungkin yang harus kita lakukan bukan memikirkan masa depan, yang perlu kita lakukan adalah kembali ke awal.\n\nDi acara ini, selain menikmati pertunjukan musik, kamu juga bisa piknik sambil:\n\n- Tarot Reading\n\n- Astrology Reading (lengkap sampai moon dan planet-planet lain)\n\n- Belanja di Preloved Market\n\n- Makan Jajanan SD\n\n- Main Mainan Retro\n\n- Main Retro Game Console\n\n- Yoga Class\n\nSampai jumpa di Membiru di Bintaro yang #GakGituGituAja\n\n---\n\nLokasi: T Space, Bintaro\n\nWaktu: Minggu, 22 Desember 2024\n\nOpen gate: 15.00 WIB\n\nSyarat & Ketentuan\n\nTiket hanya dapat dibeli melalui LOKET.com\nSatu email hanya dapat digunakan untuk satu kali transaksi.\nJumlah maksimal pembelian tiket dalam satu transaksi adalah lima tiket.\nNama pada tiket HARUS sesuai dengan nama pada kartu identitas pemegang tiket.\nJika nama yang tertera pada tiket berbeda dengan nama pada kartu identitas, diwajibkan untuk menunjukkan surat kuasa atas nama yang tertera pada tiket yang ditandatangani dan bermeterai.\nSetelah pembelian tiket berhasil, e-ticket akan dikirimkan melalui email dan Whatsapp.\nE-ticket dapat ditukarkan dengan wristband di ticket booth yang terletak di venue.\nTidak diperbolehkan membawa senjata tajam, botol kaca, benda mudah terbakar, minuman beralkohol, narkoba, dan zat terlarang lainnya.\nTiket yang sudah dibeli tidak dapat ditukar.\nSelamat bersenang-senang.\n\n*Membeli tiket berarti menyetujui Syarat & Ketentuan yang berlaku','https://assets.loket.com\neo/production/images/banner/20241207100431_6753bb3f011b5.jpg',2,3,'Bekasi Kota','2024-12-19 09:00:00','2024-12-19 17:00:00',10,10,'2024-12-16 09:32:47.158527',NULL,NULL,NULL),
	 (2,'Outdoor Yoga by Konco Yoga','Kegiatan yoga bersama di ruang terbuka kota Surabaya\n\nGet the experience of 1-hour outdoor yoga session under the sky in the city. Feel the wind, hear the water sounds and the birds chirp. Connect to your inner self through movement and breathing.\n\nTime:\n\nSunset Session every Saturday\nSunrise Session every Sunday\nLocation:\n\nSee the location at the description of every ticket or check it on @koncoyoga.sub Instagram account\n\nNotes:\n\nAll of the sessions are open for all ages and gender\nBring your own mat, tumbler, and towel\nReschedule maks. 24 jam sebelum sesi berlangsung\n\nSyarat & Ketentuan\n\nTiket yang sah adalah yang dibeli melalui website https://www.loket.com/event/outdoor-yoga-by-konco-yoga_I9bDD\nKonco Yoga tidak bertanggung jawab jika ada pembelian tiket di luar link tersebut.\nTiket yang sudah dibeli tidak dapat dikembalikan (refund).\nSatu tiket berlaku untuk satu orang.\nUntuk mengajukan reschedule harus konfirmasi MAKSIMAL 24 jam sebelum sesi yang tertera di tiket berlangsung. Bila melebihi waktu yang ditentukan, maka tiket dianggap hangus.\nHanya bisa memilih tanggal reschedule maks. 7 hari setelah tanggal yang tertera pada tiket yang dipesan\nHanya bisa memilih untuk reschedule ke jadwal dengan harga tiket yang sama atau lebih rendah.\nUntuk melakukan reschedule kirim pesan dengan format NAMA (spasi) ALAMAT EMAIL (spasi) RESCHEDULE (spasi) DD/MM/YY melalui WhatsApp 085950064060\nTunjukkan e-voucher di lokasi sebelum mulai yoga.\nKami tidak bertanggung jawab atas kehilangan atau perpindahan tangan e-voucher.\nPenyelenggara memiliki hak untuk melarang masuk pengunjung jika tiket telah dipergunakan oleh orang lain.\nPenyelenggara memiliki','https://assets.loket.com\neo/production/images/banner/20241203203040_674f08007a098.jpg',3,2,'Beji TImur','2024-12-20 09:00:00','2024-12-20 17:00:00',20,20,'2024-12-16 09:35:12.707474',NULL,NULL,NULL),
	 (2,'Juicy Luicy','Juicy Luicy merupakan sebuah grup musik asal Bandung yang dibentuk pada tahun 2006 dan sering mendapatkan penghargaan bergengsi di Indonesia. Beberapa lagu mereka sering masuk di daftar lagu paling banyak didengarkan di Spotify. Juicy Luicy dinobatkan sebagai Band of The Year Indonesia Music Awards 2023.\n\nAkhir tahun ini, Sekelik Fest mengundang Juicy Luicy untuk memeriahkan malam tahun baru di acara Lampung Night Fair 2024.\n\nSyarat & Ketentuan:\n\n1. Satu e-tiket (QR Code) HANYA BERLAKU untuk satu orang. E-ticket bersifat rahasia, jangan pernah membagikan QR code/e-ticket kalian kepada orang lain.\n2. Satu transaksi maksimal dapat melakukan pembelian lima e-tiket dan akun yang sama dapat melakukan repeat order. Khusus EARLY BIRD satu transaksi hanya bisa membeli satu e-tiket.\n3. Setiap penonton konser wajib menunjukkan e-ticket (QR Code) di tempat dan lokasi yang telah ditentukan oleh penyelenggara.\n4. Tiket hanya dapat dibeli melalui website resmi https://loket.com/. Tiket yang diperoleh dari sumber yang tidak resmi, mungkin palsu, dan tidak berlaku. Pihak penyelenggara tidak bertanggung jawab atas segala bentuk penipuan tiket yang dibeli melalui pihak lain.\n5. Panitia memiliki hak untuk mengeluarkan penonton yang melanggar peraturan dan membuat kegaduhan. Tidak ada pengembalian uang yang dilakukan atas pelanggaran yang dilakukan oleh penonton.\n6. Tiket yang telah dibeli TIDAK dapat dikembalikan/refund, kecuali atas penundaan/pembatalan acara dari panitia.','https://assets.loket.com\neo/production/images/banner/20240927192227_66f6a3835595e.jpg',1,2,'Grand Hall, City Center','2024-12-15 09:00:00','2024-12-15 17:00:00',500,500,'2024-12-14 02:05:36.999444','2024-12-14 02:05:36.999444',NULL,NULL);
